import  React, { Component } from "react"
import {ScreenLayouts} from "./FormLayouts"
import DVForms from "../DVComponents/DVForms";

type formId = {
    Id: string
}

export class FormBuilder extends React.Component<formId> {
    constructor(props){
        super(props);
    }
    private onclick(e?: Event){
        const args = "args";
        const name = "name";
        console.log(e[args]);
        alert(e[args][name]);
        // post the form data to the server and wait for response
        //Response could be - Notification / Redirect to URL / Download file etc
    }
    render() {
      return (
            <div>
                <DVForms  onButtonClick={this.onclick}
                 backgroundColor={ '#fff !important' } borderColor ={'#fff'} template={ScreenLayouts[this.props.Id]} value={ScreenLayouts["LoginScreenValue"]}></DVForms>
            </div>
        );
    }
  }
  export default FormBuilder;
